import "../css/Navbar.css";
import React from "react";


function Navbar() {
  return(
    <header>
    <nav className="Navbar.css">
      <label class="logo">Logo</label>
      <ul>
        <li><a class="active" href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>
      </ul>
    </nav>
    </header>
  )
}

export default Navbar;
